import { FaSearch } from "react-icons/fa";

const Navbar = () => {
  return (
    <div>
      <div>
        <FaSearch
          style={{ color: "lightgray", fontSize: "24px", opacity: "0.6" }}
        />
      </div>
      <div></div>
      <div></div>
    </div>
  );
};
export default Navbar;
